VALUES ('3596710359653', 'Auchan Galette Bio Blé Noir x4 - 200g', '4 galettes de blé noir biologiques. Fabrication et Distribution certifiées par Ecocert FR-BIO*O Ingrédients t eau, farine de blé noir* 33%, sel dt Guérande, biologique. Traces éventuelles de gluten, Conditionné sous atmosphère protectrice. Conseils de conservation : conserver entre OOC et +80C. Après ouverture : à consommer dans les 48h. A consommer jusquiau : voir la date inscrite sur le film& Conseils de préparation : à la poêle : placer une noix de beurre dans la poêle et étaler votre galette, sans la plier. Garnir sur une moitié avec les ingrédients de votre choix (œuf, jambon, lardons, légumes, fromage...) puis recouvrir avec l\'autre moitié de la galette. Laisser dorer chaque face, en retournant une fois. Valeurs nutritionnelles moyennes pour 100g. Energie : 719 kJ soit 170 kcal, matières grasses : 1,5g dont a. g. saturés : 0,3g, glucides : 31 ,5g dont sucres : 0,2g, fibres alimentaires : 3,3g, protéines : 6g, sel : 1,30g. Fabriqué par la Crêperie Jarnoux - ZI de Lanjouan - Rue de la Saudraie - 22404 Lamballe pour Auchan Production. Service clients - Groupe Auchan - BP 682 - 59656 Villeneuve d\'ascq cedex. - Tél. 03 5930 5930 (appel non surtaxé) - www.auchan.fr AUC V6 PENSEZ AU TRI ! 3 596710 359653', '', '1.5', '0.3', '31.5', '0.2', '3.3', '6', '1.3', '0.511811023622047', '', '0');

