VALUES ('3596710380367', 'Maxi galette jambon fromage', '1 galette de blé noir jambon fromage maxi. Produit élaboré par la Crêperie Jarnoux à Lamballe (22), 95 salariés. c»ur Auchan Production, à partir d\'ingrédients rigoureusement sélectionnés. INGR DIEN-rs jambon cuit supérieur décongelé\' (jambon de porc (origine France), sel, dextrose, arômes naturels, antioxydant : ascorbate de sodium conservateur : nitrite de sodium), emmental (contient lait origine France) 10,3%, eau, crème UHT (crème (contient lait origine France), stabilisant : carraghénanes), emmental fondu 3,2% (emmental (contient lait origine UE et lysozyme d\'œuf), fromage au lait pasteurisé (origine UE), eau, amidon, beurre (contient lait origine UE), arôme, gélifiant : carraghénanes ; sels de fonte : citrates de sodium, orthophosphate de sodium, polyphosphate ; sel), mozzarelle 3,2% (lait pasteurisé (origine UE), sel, ferments lactiques (contient lait), coagulant, correcteur d\'acidité : acide citrique, anti- agglomérant : amidon de pomme de terre), amidon modifié de pommes de terre, poudre de lait (origine France), sel. Galette (460,6) : eau, farine de blé noir (sarrasin), sel de Guérande. Ne pas recongeler. Pourcentages exprimés sur le total de la recette. Traces éventuelles de gluten. Conditionné sous atmosphère protectrice. CoNSElLS DE CONSERVATION Avant ouverture : à conserver entre OOC et +40C. Après ouverture : à conserver entre OOC et +40C et à consommer dans les 48 heures. CONSEILS DE PR PARAT10N Pour profiter d\'une galette croustillante, nous vous recommandons le réchauffage à la poêle. À la poêle : Faire fondre 2 noix de beurre dans la poêle. Réchauffer la galette 5 à 6 min. à feux doux, en la retournant une fois (la galette doit être dorée des 2 côtés). Servir et déguster.', '', '6.9', '4.4', '16', '0.6', '', '11', '1.1', '0.433070866141732', '', '0');

