INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3596710383207', 'Papillotes de poulet aux herbes de provence', 'sel, amidon de maïs, tomate, herbes de provence 9,2% (marjolaine, thym, basilic, origan), ail, paprika, sucre, oignon, arômes (contient gluten), gingembre, maltodextrine, huile de colza, acidifiant : acide citrique, poudre de jus de betterave rouge, coriandre, poivre, piment. Traces éventuelles de céleri, lait, moutarde, oeuf, poisson, soja. Conseils de conservation : avant ouverture : craint la chaleur et l\'humidité. Après ouverture : le sachet se prépare en une seule fois, Valeurs nutritionnelles moyennes pour 100g. Energie : 1155 kJ soit 274 kcal, matières grasses : 3g dont a.g. saturés : 0,4g, glucides : 47,90 dont sucres : 17,7g, fibres alimentaires : 12,4g, protéines : 7,7g, sel : 19,25g. Conseils de préparation Ajouter 4 cuisses ou 1 poulet entier (environ 1, 2 kg) Au four : déplier le sac de cuisson et mettre l\'attache de côté. Déposer la viande dans le sac de cuisson. Saupoudrer le mélange d\'aromates (pas besoin de saler). Secouer doucement pour bien répartir le mélange d\'aromates. Ajouter deux cuillères à soupe d\'eau froide. Refermer le sac avec rattache et le déposer dans un plat allant au four. Faire 3 petits trous sur le dessus du sachet Mettre à cuire dans un four préchauffé : ? Four électrique chaleur traditionnelle thermostat 7 (2000C) : placer le plat sur une grille en bas du four et laisser cuire 50 min environ pour 4 cuisses s, 1h10 environ pour 1 poulet. ? Four à gaz thermostat 6 (1800C) : placer le plat au milieu du four ; les temps de cuisson sont identiques à ceux indiques au dessus. Ouvrir le sac en faisant attention à ne pas se brûler. Ne pas utiliser la fonction grill, ni la fonction chaleur tournante de votre four. Le sac ne doit as toucher la résistance. Ne pas utiliser au four micro-onde.', '', '3', '0.4', '47.9', '17.7', '12.4', '7.7', '19.25', '7.57874015748031', '', '0');

